import './App.css';





function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getTypes());
    dispatch(getPokemons());
  });
  return (
    <>
      <Navbar />
      <Route exact path="/pokedex/:id" >
       <h1>pokemon id</h1>
      </Route>
      <Route exact path="/">
        <h1>pokemon</h1>
      </Route>
      <Route exact path="/home">

      </Route>
      <Route exact path="/create">
        <h1>create</h1>
      </Route>
      <Route exact path="/team">
        <h1>Team</h1>
      </Route>
    </>
  );
}


export default App;
